(1, '', 'Planta Artificial Monstera 1', 'planta-artificial-monstera-1', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '<p class=\"MsoNormal\" style=\"text-align: justify; line-height: normal; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\">Todos los adornos decorativos exclusivos de tendencia est√°n en&nbsp;<span style=\"font-weight: 700;\">Casa Elida</span>.<o:p></o:p></p><p></p><p class=\"MsoNormal\" style=\"text-align: justify;\"><span style=\"line-height: 17.12px; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\">Puedes tener tus flores favoritas en cualquier ocasi√≥n y en cualquier espacio de tu hogar. Agr√©gale un detalle verde a tu casa d√°ndole un dise√±o natural.</span></p><p class=\"MsoNormal\" style=\"text-align: justify;\"><span style=\"line-height: 17.12px; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"></span></p><p class=\"MsoNormal\" style=\"text-align: justify;\">Nuestras plantas artificiales de Monstera tienen hojas de forma realista. Estos vienen listos en maceta y es una planta artificial ideal para interiores. Estos se ven particularmente bien en ba√±os, oficinas y salas. Es muy realista el follaje. Los tallos est√°n cableados y se pueden dar forma a tus necesidades.&nbsp;</p>', '<p class=\"MsoNormal\" style=\"margin: 0cm 0cm 0.0001pt -4.5pt; line-height: normal; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\">Esta planta artificial\r\nes una r√©